// Generate Random Whole Numbers within a Range

// The lowest random number that can be generated by randomRange should be equal to your 
// minimum number, myMin.
// Waiting:The highest random number that can be generated by randomRange should be equal 
// to your maximum number, myMax.
// Waiting:The random number generated by randomRange should be an integer, not a decimal.
// Waiting:randomRange should use both myMax and myMin, and return a random number in your 
// range.

function randomRange(myMin, myMax) {
    // Only change code below this line
    return Math.floor(Math.random() * (myMax - myMin + 1)) + myMin ;
    // Only change code above this line
  }